import {gql} from 'apollo-boost';

const login = gql`
query login($Email: String, $Password: String){
        login(Email: $Email, Password: $Password){
            result
            userData{
                Name
                Email
                Role
              }
        }
    }`

const profile = gql`
    query profile($Email: String){
        profile(Email: $Email){
            Email
            Name
            Aboutme
            Country
            City
            Gender
            Hometown
            School
            Company
            Language
            Phone
        }
    }
`


const course = gql`
    query course($Email:String){
        course(Email: $Email){
            courses{
                Name
            }
        }
    }
`


export {login, course,profile};
